import React from 'react'

const Title =(props)=> {
    const {title } = props
    const css1 = {
        marginTop : '70px',
        textAlign : 'center'
    }
  return (
    <>
     <h3 style={css1}>{title.tit_h3}</h3>
     <p style={{textAlign: 'center'}}> 시선을 사로잡는 스타일링, 제품들을 만나보세요.</p>
    </>
  )
}

export default Title
